import { Box } from "@mui/material";
import React from "react";

const Descriptionabus = () => {
  return (
    <Box
      sx={{
        marginTop: "70px",
        padding: "30px",
        display: "flex",
        alignItems: "center",
      }}
    >
      <Box>
        <h1>Welcome to Kiddos Tradezz,</h1>
        <h2>
          the online toy sales and trading platform that brings parents and
          children together!
        </h2>
        We are a community of toy enthusiasts who love sharing and discovering
        new treasures. Our marketplace offers a wide selection of quality toys
        for kids of all ages. We pride ourselves on providing a safe and fun
        environment for kids to swap their favorite toys with other kids. At
        Kiddos Tradezz, we believe that every toy has a story and we're here to
        help create unforgettable memories.
        <h2>
          Join our community today and discover a new way to play with Kiddos
          Tradezz!
        </h2>
      </Box>
    </Box>
  );
};

export default Descriptionabus;
